    std::complex<double> MS1Sqcomp = std::complex<double>(MS1*MS1,-MS1*WS1);
    
    double t =  ((MA1*MA1) + (-s + cos_t*sqrt(s - 4.* (MA1*MA1))*sqrt(s - 4.* (MHSqcomp.real())))/2. +  (MHSqcomp.real()));
	double u = -s - t + MA1*MA1 + MA1*MA1 + MHSqcomp.real() + MHSqcomp.real();

